//import { useState, useEffect } from "react";

function Contact() {
	return (
		<div className='contact_main_container'>
			<div className='contact_title_container'></div>
			<form>
				<input type='text' />
				<input type='text' />
				<input type='text' />
				<textarea rows='10' cols='70' />
				<input type='checkbox' />
				<input type='submit' value='Submit' />
			</form>
		</div>
	);
}

export default Contact;
